import React, { useState, useEffect } from 'react';
import '../../App.css';

const RegistrationForm = ({ title, fields, onFieldUpdate, onSubmit, isSubmitting }) => {
  const [formData, setFormData] = useState({});
  const [syncPercent, setSyncPercent] = useState(0);
  const [isInternalSyncing, setIsInternalSyncing] = useState(false);
  const [dynamicFields, setDynamicFields] = useState(fields);

  useEffect(() => {
    setDynamicFields(fields);
    const initialData = {};
    fields.forEach(field => {
      if (field.value !== undefined) {
        initialData[field.id] = field.value;
      }
    });
    setFormData(prev => ({ ...prev, ...initialData }));
  }, [fields]);

  const handleChange = (e) => {
    const { name, value, files, type } = e.target;
    const fieldValue = type === 'file' ? files[0] : value;
    setFormData((prev) => ({ ...prev, [name]: fieldValue }));

    if (onFieldUpdate) {
      onFieldUpdate(name, fieldValue);
    }

    const fieldConfig = dynamicFields.find(f => f.id === name);
    if (fieldConfig && fieldConfig.onChange) {
      fieldConfig.onChange(e);
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setIsInternalSyncing(true);

    let progress = 0;
    const interval = setInterval(() => {
      progress += Math.floor(Math.random() * 15) + 5;
      if (progress >= 100) {
        setSyncPercent(100);
        clearInterval(interval);
        setTimeout(() => {
          if (onSubmit) onSubmit(formData); // This triggers the toggle in MasterTerminal
          setIsInternalSyncing(false);
          setSyncPercent(0);
        }, 800);
      } else {
        setSyncPercent(progress);
      }
    }, 150);
  };

  return (
    <div className="w-full max-w-4xl mx-auto relative group px-2 sm:px-6 lg:px-8 my-6 md:my-10">
      <div className="bg-black/85 backdrop-blur-3xl border border-white/10 rounded-2xl px-4 py-8 sm:p-10 md:p-16 shadow-[0_0_60px_rgba(0,0,0,0.9)] relative">
        <div className="text-center mb-10 md:mb-16">
          <h2 className="font-orbitron text-2xl sm:text-4xl md:text-5xl uppercase text-gradient-ai glow-ai mb-5">
            {title}
          </h2>
        </div>

        <form onSubmit={handleSubmit} className="space-y-8 md:space-y-12">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-x-10 gap-y-8">
            {dynamicFields.map((field) => (
              <div key={field.id} className={`${field.fullWidth ? "md:col-span-2" : ""}`}>
                <label className="block font-orbitron text-[9px] sm:text-[11px] uppercase tracking-[0.2em] text-[#00ffd5] mb-3">
                  {field.label}
                </label>
                <div className="relative">
                  {field.type === 'select' ? (
                    <select
                      name={field.id}
                      value={field.value || formData[field.id] || ""}
                      required={field.required}
                      onChange={handleChange}
                      className="w-full bg-white/5 border border-white/10 rounded-lg px-4 py-4 text-white font-roboto appearance-none focus:border-[#39ff14]/50"
                    >
                      <option value="" className="bg-[#030f0a]" disabled>SELECT_OPTION</option>
                      {field.options?.map((opt) => (
                        <option key={opt} value={opt} className="bg-[#030f0a] text-white">
                          {opt}
                        </option>
                      ))}
                    </select>
                  ) : field.type === 'file' ? (
                    <input
                      type="file"
                      name={field.id}
                      required={field.required}
                      onChange={handleChange}
                      accept="image/*"
                      className="w-full bg-white/5 border border-white/10 rounded-lg px-4 py-4 text-white file:bg-[#39ff14] file:text-black file:rounded-full file:px-4 file:mr-4"
                    />
                  ) : (
                    <input
                      type={field.type || "text"}
                      name={field.id}
                      value={formData[field.id] || ""}
                      placeholder={field.placeholder}
                      required={field.required}
                      onChange={handleChange}
                      className="w-full bg-white/5 border border-white/10 rounded-lg px-4 py-4 text-white focus:border-[#39ff14]/50"
                    />
                  )}
                </div>
              </div>
            ))}
          </div>

          <div className="pt-8 md:pt-12">
            <button
              type="submit"
              disabled={isInternalSyncing || isSubmitting}
              className="w-full h-14 sm:h-20 bg-gradient-to-r from-[#39ff14] via-[#00ffd5] to-[#39ff14] rounded-xl font-orbitron font-black text-black tracking-widest uppercase hover:scale-[1.02] transition-transform"
            >
              {isInternalSyncing ? `NEURAL_SYNCING_${syncPercent}%` : 'INITIALIZE_REGISTRATION'}
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default RegistrationForm;
